import { useNavigate } from "react-router-dom";

export default function Support() {
  const navigate = useNavigate();

  const goBack = () => {
    // Regresa a la página anterior
    navigate(-1);
  };

  return (
    <div style={{ padding: "20px", textAlign: "center" }}>
      {/* Botón de regreso con ícono */}
      <button
        onClick={goBack}
        style={{
          background: "#38764c",
          color: "#fff",
          fontSize: "16px",
          padding: "12px 24px",
          border: "none",
          borderRadius: "8px",
          cursor: "pointer",
          boxShadow: "0 2px 8px rgba(0, 0, 0, 0.2)",
          display: "flex",
          alignItems: "center",
          gap: "8px",
          marginBottom: "20px"
        }}
      >
        {/* Ícono de flecha */}
        <svg
          xmlns="http://www.w3.org/2000/svg"
          fill="none"
          viewBox="0 0 24 24"
          stroke="currentColor"
          width="20"
          height="20"
          style={{ marginRight: "8px" }}
        >
          <path
            strokeLinecap="round"
            strokeLinejoin="round"
            strokeWidth="2"
            d="M15 19l-7-7 7-7"
          />
        </svg>
        Volver
      </button>

      <h2 style={{ color: "#38764c" }}>Página de Soporte</h2>
      <p style={{ fontSize: "18px", color: "#38764c" }}>
        Aquí puedes encontrar respuestas a tus preguntas o contactarnos directamente.
      </p>

      {/* Aquí puedes agregar más contenido de soporte */}
      <div style={{ marginTop: "20px" }}>
        <p>Para más ayuda, por favor contáctanos.</p>
      </div>
    </div>
  );
}
